export class AppComponent {
  title = 'springelectricity1';
}
<h1>Welcome to Electricity Bill Generator</h1>
<h3>Choose your role</h3>
<a routerLink="/admin-dashboard"><h4>Admin</h4></a>
<a routerLink="/consumer-dashboard"><h4>Consumer</h4></a>
